        title: "About PIAHS",
        subtitle: "",
        slug: "about_piahs",
        order: 1,
        status: "ACTIVE",
        content:
          '<h3 class="ql-align-justify"><span style="color: rgb(68, 68, 68);">With an aspiration towards becoming&nbsp;the most reputed and trusted healthcare brand in the North Eastern State&nbsp;, Pratiksha Educational Trust laid down its foundation&nbsp;in the year 2017 to provide a quality healthcare education&nbsp;in the state. The trust which is already recognized for its clinical excellence, innovation and compassion is now offering the educational programs that anticipate specialized professionals, needed locally , nationally and internationally. It will prepare graduates to function effectively in multifaceted role in a variety of settings to promote the health and well-being of people. The institute seeks to enroll students who represent racial, cultural and geographic diversity. The trust also regard it as its responsibility to prepare the student industry acquitted and skillful.</span></h3><p class="ql-align-justify"><span style="color: rgb(68, 68, 68);">&nbsp;</span></p><h2 class="ql-align-justify"><strong style="color: rgb(0, 71, 178);">Vision</strong></h2><p class="ql-align-justify"><br></p><h3 class="ql-align-justify"><span style="color: rgb(68, 68, 68);">To become one of&nbsp;the most preferred educational destination in whole of North East India for rendering&nbsp;quality education in an&nbsp;environment of high academic standard complementing with high quality ethos , values and competence.</span></h3><p class="ql-align-justify">&nbsp;</p><h2 class="ql-align-justify"><strong style="color: rgb(0, 71, 178);">Mission</strong></h2><p class="ql-align-justify"><br></p><h3 class="ql-align-justify"><span style="color: rgb(68, 68, 68);">To build skilled, socially responsible and industry ready professionals . To produce a new generation of professionals or entrepreneurs who will easily put a leverage to the&nbsp;economic growth &amp; societal relevance.</span></h3>',
        pageType: "dynamic",
        createdAt: "2023-05-22T06:04:41.604Z",
