        userId: "6435365c20ff4ae0657b6eb3",
        title: "Why Choose PIAHS?",
        subtitle: "",
        slug: "why_choose_piahs",
        order: 2,
        status: "ACTIVE",
        content:
          '<p class="ql-align-justify"><br></p><ul><li class="ql-align-justify">We believe in nurturing a student with all requisite knowledge and skill.</li><li class="ql-align-justify">PIAHS produces industry ready students.</li><li class="ql-align-justify">Only college in entire Northeast to have dissection classes.</li><li class="ql-align-justify">Experienced and learned faculties.</li><li class="ql-align-justify">Top notch clinical experience at Pratiksha&nbsp;Group of Hospitals.</li><li class="ql-align-justify">Well-equipped Outpatient department and&nbsp;laboratories.</li><li class="ql-align-justify">Convenient transportation services.</li><li class="ql-align-justify">On campus hostel.</li><li class="ql-align-justify">Library with sufficient numbers of books .</li><li class="ql-align-justify">Computer labs with internet facilities for the access of students</li></ul><p class="ql-align-justify"><br></p><h2 class="ql-align-justify"><strong style="color: rgb(0, 71, 178);">About Pratiksha Hospital</strong></h2><h3 class="ql-align-justify">&nbsp;</h3><h4 class="ql-align-justify">Pratiksha Hospital is a superspeciality hospital with the state of art technology providing medical excellence with human touch within the reach of every individual. The main focus of the hospital is in depth intensive analysis and treatment under one roof, specialized in state of art Assisted Reproductive Technique (IVF ) , Minimal Invasive Surgery , Maternity Services, Foetal Medicine , Pediatrics with Neonatal ICU and PICU , Modern ICU , General Medicine, Orthopaedics , ENT, Opthalmology , Onco Surgery , Dentistry and Paediatric Surgery . Besides having a world class technology today it is understood that Biomedical&nbsp;engineering is another specialized area where every day new developments are witnessed . Qualified human resources like doctors, nurses, Paramedical and administrative staff are the backbone of any world class health institution . Pratiksha Hospital is glad to have all these super speciality departments and quality human resources under one roof which itself promise to give quality treatment and care.</h4>',
