        order: 0,
        status: "ACTIVE",
        content:
          '<p><img src="data:image/png;base64,"></p><p><br></p><p class="ql-align-justify"><br></p><h3 class="ql-align-justify"><span style="color: rgb(68, 68, 68);">Greetings from the Pratiksha Institute of Allied Health Sciences&nbsp;</span></h3><h3 class="ql-align-justify"><br></h3><h3 class="ql-align-justify"><span style="color: rgb(68, 68, 68);">It is indeed a matter of privilege for me to introduce you all to a great new venture of ‘ Pratiksha Educational Trust’ the ‘Pratiksha Institute of Allied Health Sciences, Panikhaiti’. This Institute has incepted as per the visionary thought of our Honourable Chairman , Dr Pramod Kr Sharma . This Institute is an ideal educational destination for aspirants all across India who intend to serve the society being associated as an health care service provider . The vibrant atmosphere of the college campus located next to the mighty Brahmaputra adds on to the outlook of the students. The Institute provides well experienced, dynamic and energetic faculties with modern lecture rooms, laboratories with sophisticated equipments. The Institute’s prime focus is to make all its outgoing students industry ready so that they can easily cope up with the demand of the health care delivery system. The Institute follows the 3 important principles of discipline, sincerity and moral ethical value. All the students are rigorously trained in the mother hospital of Pratiksha group. We provide job guarantee to each one of the students passing out from this Institute. We welcome each of the aspirants to be a part of this esteemed Institute and to take a leap in their career.&nbsp;</span></h3>',
